<p>return new SequentialCommandGroup(<br>
new InstantCommand(() → {<br>
// Reset odometry for the first path you run during auto<br>
if(isFirstPath){<br>
this.resetOdometry(traj.getInitialHolonomicPose());<br>
}<br>
}),<br>
new PPSwerveControllerCommand(<br>
traj,<br>
this::getPose, // Pose supplier<br>
this.kinematics, // SwerveDriveKinematics<br>
new PIDController(0, 0, 0), // X controller. Tune these values for your robot. Leaving them 0 will only use feedforwards.<br>
new PIDController(0, 0, 0), // Y controller (usually the same values as X controller)<br>
new PIDController(0, 0, 0), // Rotation controller. Tune these values for your robot. Leaving them 0 will only use feedforwards.<br>
this::setModuleStates, // Module states consumer<br>
eventMap, // This argument is optional if you don’t use event markers<br>
this // Requires this drive subsystem<br>
)<br>
);</p>
<p>In specific we were trying to figure out out how to implement the setModuleStates method. We have tried looking at other teams code but we struggled to understand the code and only ended up more confused. If anybody knows how to implement the setModuleStates method in Java for pathplanner that would be greatly appreciated.</p>
<p>Our full code is here: <a href="https://github.com/FRC5549Robotics/BunnyBots_2022" rel="noopener nofollow ugc">https://github.com/FRC5549Robotics/BunnyBots_2022</a></p>
